import React from 'react';

function TodoItem(props) {
	const { items } = props;
	const ListItems = items.map((item) => {
		return (
			<div key={item.id}>
				<span> {item.name}</span>
				<span> {item.age}</span>
			</div>
		);
	});
	return <div>{ListItems}</div>;
}
export default TodoItem;
